import React, { Component } from 'react';
import { BrowserRouter as Router } from 'react-router-dom'
import { Header } from './components/index'
import './App.css';

class App extends Component {
  render() {
    return (
      <Router>
        <section className="home">
          <Header />
        </section>
      </Router>
    );
  }
}

export default App;
